// src/components/Profile.jsx
import React, { useEffect, useState } from 'react';
import { getCurrentUser, updateProfile } from '../services/authServices';
import { useNavigate } from 'react-router-dom';

const Profile = () => {
  const user = getCurrentUser();
  const [profileData, setProfileData] = useState({
    coor_fname: '',
    coor_lname: '',
    coor_username: '',
    coor_email: '',
    coor_contact: '',
    coor_address: '',
    coor_role: '',
  });

  const [error, setError] = useState('');
  const navigate = useNavigate();

  // Initialize profile data from user
  useEffect(() => {
    if (user) {
      const { coor_fname, coor_lname, coor_username, coor_email, coor_contact, coor_address, coor_role } = user;
      setProfileData({ coor_fname, coor_lname, coor_username, coor_email, coor_contact, coor_address, coor_role });
    } else {
      navigate('/login'); // Redirect to login if no user is found
    }
  }, [user, navigate]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfileData({ ...profileData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const updatedData = await updateProfile(user.id, profileData);
      console.log('Profile updated successfully:', updatedData);
      alert('Profile updated successfully!');
    } catch (err) {
      setError(err.message || 'Failed to update profile.'); // Ensure you're capturing the error message
    }
  };
  

  return (
    <div>
      <h1>User Profile</h1>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <form onSubmit={handleSubmit}>
        <div>
          <label>First Name:</label>
          <input
            type="text"
            name="coor_fname"
            value={profileData.coor_fname}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Last Name:</label>
          <input
            type="text"
            name="coor_lname"
            value={profileData.coor_lname}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Username:</label>
          <input
            type="text"
            name="coor_username"
            value={profileData.coor_username}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            name="coor_email"
            value={profileData.coor_email}
            onChange={handleChange}
            required
          />
        </div>
        <div>
          <label>Contact:</label>
          <input
            type="text"
            name="coor_contact"
            value={profileData.coor_contact}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Address:</label>
          <textarea
            name="coor_address"
            value={profileData.coor_address}
            onChange={handleChange}
          />
        </div>
        <div>
          <label>Role:</label>
          <select
            name="coor_role"
            value={profileData.coor_role}
            onChange={handleChange}
            disabled={user.coor_role !== 'Admin'} // Admin can change the role
          >
            <option value="Admin">Admin</option>
            <option value="Coordinator">Coordinator</option>
          </select>
        </div>
        <button type="submit">Update Profile</button>
      </form>
    </div>
  );
};

export default Profile;
